import React, { useState, useEffect } from "react";
import DataTable from 'react-data-table-component';

export default function Cablecom(url){
    var userurl= url
    const [data, setData] = useState(null);
    useEffect(()=>{
      fetch(userurl)
        .then(response => response.json())
        .then((data) => setData(data));
      },[]);

      const columns = [
        {
            name: 'Personaje',
            selector: 'character',
        },
        {
          name: 'Frase',
          selector: 'quote',
        },
        {
          name: 'Imagen',
          selector: 'image',
        },
        {
          name: 'Orientacion politica',
          selector: 'characterDirection',
        },
      ];

    return(
        <DataTable
        title="Fraces de los simpson"
        columns={columns}
        data={data}
      />
    )

}
